selector_to_html = {"a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232ANEW2A.png\"><img alt=\"../../media/25232ANEW2A.png\" src=\"../../media/25232ANEW2A.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Limpar o c\u00f3digo de barras armazenado</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#enable-automatic-storage-mode2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Ativar Modo de Armazenamento Autom\u00e1tico<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#enable-automatic-storage-mode2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523NORMD.png\"><img alt=\"../../media/2523NORMD.png\" src=\"../../media/2523NORMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modo Normal</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Durante o carregamento de dados, escanear o comando \u00abUpload de dados\u00bb novamente cancelar\u00e1 / interromper\u00e1 o envio de dados.</p>\n</aside>", "a[href=\"#data-upload1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Envio de dados<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id11\"]": "<figure class=\"align-center\" id=\"id11\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23On.png\"><img alt=\"../../media/25AutoSav23On.png\" src=\"../../media/25AutoSav23On.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Ativar modo de armazenamento autom\u00e1tico</span><a class=\"headerlink\" href=\"#id11\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#working-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de trabalho<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>Na \u00e1rea de trabalho fora do limite de 2. Receptor G ou sinal Bluetooth, voc\u00ea pode ativar o modo de armazenamento do scanner, seguindo as etapas descritas abaixo. Neste modo, todos os dados digitalizados ser\u00e3o armazenados diretamente no scanner. Antes de enviar os dados, ser\u00e1 guardado permanentemente no scanner para que voc\u00ea possa carregar os dados quando o scanner estiver no intervalo de sinal de recebimento.</p>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232BTCNT.png\"><img alt=\"../../media/25232BTCNT.png\" src=\"../../media/25232BTCNT.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Quantidade total de armazenamento</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523TXMEM.png\"><img alt=\"../../media/2523TXMEM.png\" src=\"../../media/2523TXMEM.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Upload de dados</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#disable-automatic-storage-mode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Desativar modo de armazenamento autom\u00e1tico<a class=\"headerlink\" href=\"#disable-automatic-storage-mode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#total-storage-quantity\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Quantidade total de armazenamento<a class=\"headerlink\" href=\"#total-storage-quantity\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523INVMD.png\"><img alt=\"../../media/2523INVMD.png\" src=\"../../media/2523INVMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modo de armazenamento</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23Off.png\"><img alt=\"../../media/25AutoSav23Off.png\" src=\"../../media/25AutoSav23Off.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Desativar modo de armazenamento autom\u00e1tico</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>Em modo de transmiss\u00e3o sem fio, quando o modo de armazenamento autom\u00e1tico \u00e9 ativado, o c\u00f3digo de barras ser\u00e1 automaticamente armazenado quando a transmiss\u00e3o falhar, e os dados armazenados podem ser obtidos atrav\u00e9s de \u00abCarregamento de dados\u00bb.</p>\n</aside>", "a[href=\"#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de armazenamento<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Envio de dados<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#clear-stored-barcode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Limpar o c\u00f3digo de barras armazenado<a class=\"headerlink\" href=\"#clear-stored-barcode\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
